import {Link} from "react-router-dom";


function Header(){
    return(
       
        <header>
            <Link to ="/">
                <p clasName= "navbar navbar-brand" >Greedy Techniques</p> 
            </Link>
            <Link to ="/">
                <p clasName= "navbar navbar-brand" >Greedy Techniques</p> 
            </Link>
            <Link to ="/">
                <p clasName= "navbar navbar-brand" >Greedy Techniques</p> 
            </Link>
            
        </header>
       

        

        

      




    )
}

export default Header;
